import React, { useRef, useEffect, useState } from 'react';
import Layout from '../../components/Layout';
import Header from '../../components/Header';
import mapboxgl from "mapbox-gl";
import AccessTokenService from "../../services/AccessTokenService";
import UserDataService from "../../services/UserDataService";

mapboxgl.accessToken = 'pk.eyJ1IjoiaGljY3VwLXN0YWZmIiwiYSI6ImNsangxeHVkbzAyNmwzdHJ4cmJiYWZmMm4ifQ.yI4259jlMq2elDiT_uK1kg';

export async function getServerSideProps(context) {
  const accessToken = AccessTokenService.get();
  return {
    props: {
      accessToken: accessToken || null
    }
  };
}

export default function Control () {
    const [data, setData] = useState({});
    const [lng, setLng] = useState(2.35);
    const [lat, setLat] = useState(48.85);
    const [zoom, setZoom] = useState(10);
    const map = useRef(null);
    const mapContainer = useRef(null);

    useEffect(() => {
        console.log("access_token : " + console.log(JSON.stringify(accessToken)));
        const user_data = UserDataService.get();
        if (map.current) return; // initialize map only once
        map.current = new mapboxgl.Map({
        container: mapContainer.current,
        style: 'mapbox://styles/mapbox/streets-v12',
        center: [lng, lat],
        zoom: zoom
        });

        async function fetchGeoJSON() {
            try {
                const requestData = "{\"user\": {\"id\": " + user_data.id + " +, \"roles\":" +  user_data.roles + "}";
                const requestOptions = {
                    method: 'POST',
                    headers: {
                      'Content-Type': 'application/json',
                      'Authorization': 'Bearer ' + accessToken,
                    },
                    body: requestData
                  };
                url = "https://pro-hikup.westeurope.cloudapp.azure.com/api/trail/retrieve";
                await fetch(url, requestOptions)
                .then(response => {
                  console.log("response: " + response);
                  const parsed = JSON.parse(response.data["trails"]);
                  setData(parsed);
                })
                .catch(error => {
                  console.error('Error:', error);
                });
             } catch (error) {
                 console.error('Error fetching GeoJSON:', error);
               }
             }
            fetchGeoJSON();

        map.current.on("load", function () {
          const data = setData;
          data.forEach(data => {
            map.current.loadImage(
              "https://docs.mapbox.com/mapbox-gl-js/assets/custom_marker.png",
              function (error, image) {
                if (error) throw error;
                map.current.addImage("custom-marker", image);
                map.addSource("points", {
                  type: "geojson",
                  data: {
                    type: "FeatureCollection",
                    features: data.geoJSON,
                  },
                });
            })});

            map.current.addControl(new mapboxgl.NavigationControl(), "top-right");
            return () => map.current.remove();
        });
    });

    return (
        <Layout>
                <style jsx>{`
                    .map-container {
                        position: absolute;
                        width: 100%;
                        height: 100%;
                    }
                    `}</style>
                    <div ref={mapContainer} className="map-container"/>
            <title>Hik'UP Admin</title>
        </Layout>
    );
}
